import logo from '../assets/images/coffee-cups.png'
import '../css/navbar.css'

function Navbar(){
    return (
        <div className="navbar">
            <div className="header-logo">
                <img src= {logo} className="logo"/>
            </div>
        </div>
    );
};


export default Navbar;
